Ubehage's MemEater v1.1
-----------------------

This is a small and quite simple application.
It will consume your computer's memory, nothing more or less.

With this tool, you will be able to experience how Windows behaves when it runs out of memory.



Updates in this release:
- Now, you have to manually click the button to consume 1GB of memory each time.

There is no automated process, that will be able to run amok when Windows stops responding.


